import React from 'react';
import './HomeScreen.css';

const HomeScreen = ({ onPlay, onRules, onLeaderboard }) => {
  return (
    <div className="emu-container">
      <h1 className="gameTitle">Titolo del Videogioco</h1>
      <div className="button-container">
        <button className="homeButton" onClick={onPlay}>Play</button>
        <button className="homeButton" onClick={onRules}>Regolamento</button>
        <button className="homeButton" onClick={onLeaderboard}>Classifica</button>
      </div>
    </div>
  );
};

export default HomeScreen;
